import{_ as e,o,c as t,O as i}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 20-88.79 Grounds for rendition.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/20-88.79.md","filePath":"vacode/20-88.79.md"}'),n={name:"vacode/20-88.79.md"},r=i('<h1 id="§-20-88-79-grounds-for-rendition" tabindex="-1">§ 20-88.79 Grounds for rendition. <a class="header-anchor" href="#§-20-88-79-grounds-for-rendition" aria-label="Permalink to &quot;§ 20-88.79 Grounds for rendition.&quot;">​</a></h1><p>A. For purposes of this article, &quot;governor&quot; includes an individual performing the functions of governor or the executive authority of a state covered by this chapter.</p><p>B. The Governor of this Commonwealth may:</p><ol><li><p>Demand that the governor of another state surrender an individual found in the other state who is charged criminally in this Commonwealth with having failed to provide for the support of an obligee; or</p></li><li><p>On the demand by the governor of another state, surrender an individual found in this Commonwealth who is charged criminally in another state with having failed to provide for the support of an obligee.</p></li></ol><p>C. A provision for extradition of individuals not inconsistent with this chapter applies to the demand even if the individual whose surrender is demanded was not in the demanding state when the crime was allegedly committed and had not fled therefrom.</p><p>1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0673" target="_blank" rel="noreferrer">673</a>.</p>',6),a=[r];function d(s,h,l,c,p,f){return o(),t("div",null,a)}const m=e(n,[["render",d]]);export{_ as __pageData,m as default};
